function Filter() {
  const position = {};
  return (
    <div>
      <h3>Filter</h3>
      <Price />
      <Discount />
      <Color />
      <Size />
    </div>
  );
}

export default Filter;

// Sub-components

function Price() {
  return (
    <div>
      <h5>Price</h5>
    </div>
  );
}

function Discount() {
  return (
    <div>
      <h5>Discount</h5>
    </div>
  );
}

function Color() {
  return (
    <div>
      <h5>Color</h5>
    </div>
  );
}

function Size() {
  return (
    <div>
      <h5>Size</h5>
    </div>
  );
}
